/*Data for the table `bienvenidos` */

insert  into `bienvenidos`(`id`,`titulo`,`subtitulo`,`texto`,`globo`,`img`) values (1,'BIENVENIDOS','A NUESTRO MUNDO DE TECNOCIENCIA','Somos una compañía importadora de productos para laboratorio líder en el mercado Colombiano; nuestro amplio portafolio cubre en su totalidad las líneas para laboratorios de Control de calidad, Análisis, Microbiología, Biotecnología, Biología molecular, monitoreo ambiental e investigación. Convirtiéndonos es una prestigiosa agrupación que representa en nuestro país a mas de 25 multinacionales renombradas a nivel internacional y cuyo único objetivo es ser los mejores.   \n\n\n\n\n\n','HOLA!!! Soy NORTRONIK, el asistente virtual de NORQUIMICOS, estaré presente en varios procesos para ayudarte y mostrarte lo facil y dinamico que es trabajar con nosotros.\n\n','destacados_1.png');

